            <h2 data-type="2" data-text="생각 깨우기">
                <div class="fraction-text-column">
                    <div class="fraction-text-align">
                        유기견들에게 사료를 소윤이는
                        <div class="f32b">
                            <span class="whole"></span>
                            <div class="fraction_box">
                                <span>3</span>
                                <span>4</span>
                            </div>            
                        </div>
                        kg, 지후는
                        <div class="f32b">
                            <span class="whole"></span>
                            <div class="fraction_box">
                                <span>5</span>
                                <span>8</span>
                            </div>            
                        </div>
                        kg 나누어 주었습니다. 소윤이와 지후가 나누어 준 사료는 모두 몇 kg인지
                    </div>
                    <div class="fraction-text-align">
                        알아봅시다.
                    </div>
                </div>
            </h2>
